INSERT INTO `comment` VALUES ('113y9sem', 'S***t', '//s11.mogucdn.com/p2/161214/103488673_527fecjlbb7f05fihi1aggde73jb8_140x140.png', '1521647476', '颜色:牛仔裤 尺码:M ', '看上的衣服都会买到手的，中间退换过一次，客服服务超好，耐心告诉我怎么操作，还打电话跟我说，很细心的。衣服穿上超级显瘦，同学都说好看。满意，图是晚上俯拍的，明天再补图', '1ls2lf8');
INSERT INTO `comment` VALUES ('113zc6yi', '紫梦轩宇88', '//s5.mogucdn.com/p2/161214/103488673_8da6lhkf9a5h32ei6bd297523c35d_140x140.png', '1521792962', '颜色:马甲毛衣 尺码:L ', '这款衣服质量很好，做工不错，穿上挺合适时尚漂亮，喜欢这款，好评', '1lr9l3a');
