INSERT INTO `comment` VALUES ('114ge4jk', '就鸟少女空', '//s3.mogucdn.com/p2/161214/103488673_65bf62g5e98f4g9b8dk1j5le13e34_140x140.png', '1524282478', '颜色:NCOMMON白色 尺码:L ', '宝贝收到非常满意，跟图片一样没有色差，物美价廉，物流快，卖家服务态度很好，真实评价全五星。还会来光顾。', '1lxnnys');
