INSERT INTO `comment` VALUES ('114sxrmk', '爱你的人是我1978', '//s3.mogucdn.com/p2/161214/103488673_8ff131b8g07810e345268cgcda6ef_140x141.png', '1526394379', '颜色:酒红色 尺码:S ', ' 很漂亮的衣服，本以为红色不会适合我，没想到挺意外的，很显白 也挺显瘦 关键是搭黑色的裙子 裤子超级美，简洁的款式，很有范儿，有喜欢的人可以赶紧下手，毕竟这个价格真的是很实惠', '1ltwdgi');
