INSERT INTO `comment` VALUES ('11682yxa', '冒险脱菊', '//s3.mogucdn.com/p2/161214/103488673_8ff131b8g07810e345268cgcda6ef_140x141.png', '1536979699', '颜色:焦糖色 尺码:S ', '量很不错，做工精细，穿着很舒服，物有所值了，卖家发货及时，包装严实，没有损坏，非常满意，朋友来了都说挺好的，价格更是比外面的价格实惠多了，很好的卖家，下次有需要，还会来光顾的～衣服穿起来真的很显白显瘦，衣服真真的好，特别厚实，这个季节穿正好。我很喜欢', '1m8k4ps');
